import React, { useState, useEffect } from 'react';
import { STATUS_OPTIONS } from '../constants';

export default function AdminPanel({ promises, onEdit, onDelete, onSave, editItem, onCancel }) {
  const [form, setForm] = useState(editItem || {
    text: '',
    category: '',
    source: '',
    status: 'Not Started',
    lastUpdated: new Date().toISOString().slice(0,10),
    updates: []
  });
  const [newUpdate, setNewUpdate] = useState('');

  useEffect(() => {
    if (editItem) {
      setForm(editItem);
    }
  }, [editItem]);

  function handleSubmit(e) {
    e.preventDefault();
    onSave(form);
    setForm({
      text: '',
      category: '',
      source: '',
      status: 'Not Started',
      lastUpdated: new Date().toISOString().slice(0,10),
      updates: []
    });
    setNewUpdate('');
  }

  function addUpdate() {
    if (newUpdate.trim()) {
      setForm(old => ({
        ...old,
        updates: [...(old.updates || []), { date: new Date().toISOString().slice(0,10), note: newUpdate }],
      }));
      setNewUpdate('');
    }
  }

  return (
    <div className="bg-white dark:bg-gray-800 rounded-lg p-6 shadow-sm">
      <h2 className="text-lg font-semibold mb-4 text-gray-900 dark:text-gray-100">Admin Dashboard</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
        <form onSubmit={handleSubmit} className="space-y-3">
          <input value={form.text} onChange={e => setForm({...form, text: e.target.value})}
            placeholder="Promise text" className="w-full p-2 border rounded dark:bg-gray-700 dark:border-gray-600" required />
          <input value={form.category} onChange={e => setForm({...form, category: e.target.value})}
            placeholder="Category" className="w-full p-2 border rounded dark:bg-gray-700 dark:border-gray-600" required />
          <input value={form.source} onChange={e => setForm({...form, source: e.target.value})}
            placeholder="Source" className="w-full p-2 border rounded dark:bg-gray-700 dark:border-gray-600" />
          <select value={form.status} onChange={e => setForm({...form, status: e.target.value})}
            className="w-full p-2 border rounded dark:bg-gray-700 dark:border-gray-600">
            {STATUS_OPTIONS.map(s => (<option key={s}>{s}</option>))}
          </select>

          <div className="space-y-2">
            <textarea value={newUpdate} onChange={e => setNewUpdate(e.target.value)}
              placeholder="Add an update note..." className="w-full p-2 border rounded dark:bg-gray-700 dark:border-gray-600" />
            <button type="button" onClick={addUpdate}
              className="px-3 py-1 bg-gray-200 dark:bg-gray-700 rounded hover:bg-gray-300 dark:hover:bg-gray-600 transition">
              Add Update
            </button>
          </div>

          <button type="submit" className="px-4 py-2 rounded bg-emerald-500 text-white hover:bg-emerald-600">
            {editItem ? 'Save Changes' : 'Add Promise'}
          </button>
          {editItem && (
            <button type="button" onClick={onCancel}
              className="ml-2 text-sm underline text-gray-700 dark:text-gray-200">Cancel Edit</button>
          )}
        </form>

        <div>
          <h3 className="text-sm font-medium mb-2 text-gray-900 dark:text-gray-100">Existing Promises</h3>
          <ul className="space-y-2 max-h-[60vh] overflow-auto">
            {promises.map(p => (
              <li key={p.id} className="flex justify-between bg-gray-50 dark:bg-gray-700 p-2 rounded">
                <div className="text-sm text-gray-900 dark:text-gray-100">{p.text}</div>
                <div className="space-x-2 text-xs">
                  <button onClick={() => onEdit(p)} className="text-blue-600 dark:text-blue-400 hover:underline">Edit</button>
                  <button onClick={() => onDelete(p.id)} className="text-red-600 dark:text-red-400 hover:underline">Delete</button>
                </div>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
}
